Here’s an HTML file that showcases the specified backgrounds with their corresponding text colors. Each section has a colored background and text displaying the associated colors.

```html
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Color Showcase</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            padding: 20px;
        }
        .color-section {
            margin-bottom: 20px;
            padding: 20px;
            border-radius: 5px;
            color: #ffffff;
            font-weight: bold;
        }
        .black-bg {
            background-color: #000000;
            color: #bdbdbd; /* Default text color */
        }
        .black-bg .orange-text { color: #f7931e; }
        .black-bg .yellow-text { color: #fec34e; }
        .black-bg .white-text { color: #ffffff; }

        .light-gray-bg {
            background-color: #eaeaea;
            color: #ff9900; /* Default text color */
        }
        .light-gray-bg .gray-text { color: #676767; }

        .very-light-gray-bg {
            background-color: #fafafa;
            color: #ff9900; /* Default text color */
        }
        .very-light-gray-bg .dark-gray-text { color: #676767; }
        .very-light-gray-bg .orange2-text { color: #f7941e; }
        .very-light-gray-bg .blue-text { color: #4a8cf6; }
        .very-light-gray-bg .green-text { color: #00a857; }
    </style>
</head>
<body>
    <div class="color-section black-bg">
        <h2>On Black Background</h2>
        <p class="light-gray-text">#bdbdbd (Light Gray)</p>
        <p class="orange-text">#f7931e (Orange)</p>
        <p class="yellow-text">#fec34e (Yellow)</p>
        <p class="white-text">#ffffff (White)</p>
    </div>

    <div class="color-section light-gray-bg">
        <h2>On Light Gray Background</h2>
        <p class="orange-text">#ff9900 (Orange)</p>
        <p class="gray-text">#676767 (Gray)</p>
    </div>

    <div class="color-section very-light-gray-bg">
        <h2>On Very Light Gray Background</h2>
        <p class="orange-text">#ff9900 (Orange1)</p>
        <p class="dark-gray-text">#676767 (Dark Gray)</p>
        <p class="orange2-text">#f7941e (Orange2)</p>
        <p class="blue-text">#4a8cf6 (Blue)</p>
        <p class="green-text">#00a857 (Green)</p>
    </div>
</body>
</html>
```

### How to Use:
